#!/bin/bash
check_ps(){
        count=`ps -ef | grep hive | wc -l`
        echo "count before while ******** "$count
        while [ $count -gt 20 ]
		do
   			sleep 5	
   			count=`ps -ef | grep hive | wc -l`
   			echo "count in while @@@@@@@@ "$count
		done
}


hive -e "DROP TABLE IF EXISTS ISIN_USER";
hive -e "CREATE TABLE isin_user(ucc string,isin string,bdate date,price float)";

